import TodoItem from "../TodoItem"

const TodoList = ({todos, toggleComplite, deleteTodo}) => {
    return <div>
        {   todos.length === 0 ? <div>Задач нет</div> :

            todos.map((todo) => (
                <TodoItem
                    key={todo.id}
                    todo = {todo}
                    toggleComplite = {toggleComplite}
                    todoDelete = { deleteTodo }
                />
            ))
        }
    </div>
}

export default TodoList;
